		"text": "\"통상적으로, 건물은 수직방향으로 커다란 힘에 의해 당겨지는 상황까지는 예측되지 않기 때문에, 기둥의 접합부도 수직방향의 힘에 대해서는 약한구조로 되어 있습니다. 그렇기 때문에 빌딩 전체가 한순간에 주저앉듯이 붕괴되었던 것입니다.\"",
