		"text": "독학자에게 가장 어려운 것은 권위에 대한 균형감각이 아닐까 싶어요. 주류학계에 대한 불신, 저는 이런 건 없거든요. 오히려 시스템을 믿고, 다만 거기에 편입되는 것을 거부했을 뿐. 제가 불신하는 것은 '방법적 회의'가 없는 맹신 그 자체.",
