		"id": 787662065154478100,
		"id_str": "787662065154478080",
		"text": "정태적 속성은 불변하는 질서를 암시하고, 이것은 다시 초월성에 의한 코스모스를 떠올리게 함. 그래서 구조와 체계가 결정적으로 달라지는 지점은 바로 여기이며, 이 차이를 감지하지 못하는 것은 사상사/이론사의 전체적인 윤곽을 잡지 못했단 것.",
