		"id_str": "787661361153052673",
		"text": "(동포모뿐만 아니라) 실제 이뤄진 연구를 보면 '과학적이고자' 했던 방법론과는 달리, 둘은 종종 긴밀히 조응해왔으며, 때로는 구조에서 상정되지 않은 초월성을 읽어내어 허수아비를 치는 비평도 수행되었음. 이것은 구조의 정태적 속성으로 말미암았던 것.",
