		"id_str": "787315055045988352",
		"text": "'타자의 욕망, 신념, 속생각을 인식하는 능력, 즉 마음이론(theory of mind)이 인간의 전유물인가'\n'타자의 틀린 믿음을 이해한다는 것은 마음이론의 핵심'\n\n타자와의 커뮤니케이션이 '목숨을 건 도약'이라 보는 시각이 틀린 이유.",
