		"id_str": "787314099478605825",
		"text": "\"2007년 발표된, 유아를 대상으로 수행된 연구 결과가 기존의 통념에 이의를 제기했다. 연구의 내용은 예상 밖이었다. 연구자들이 참가자 몰래 물건을 치웠는데, 생후 25개월짜리 아기가 '참가자가 물건을 찾으려고 헤맬 장소'를 바라본 것이다.\"",
