		"text": "\"그래서 지젝은 마르크스-레닌주의자이기도 하고 아니기도 한, ‘전능하며’, 그래서 ‘위험한’ 공산주의자로 대중적으로, 그리고 문화산업적으로 소비된다. 그리하여 지젝은 실제로는 공허한, 그리고 결코 위험하지 않은 철학자로 다시 한 번 각광받게 된다.\"",
