		"text": "\"자신을 공산주의자라고 분명하게 명명하지만 그의 공산주의의 내용은 모호함 그 자체 / 지젝 수용자들에게 동상이몽의 환상을 불러일으킨다/ 그는 이론적인 책과, 대중강연 혹은 신문이나 잡지 기고문의 내용을 잘 구분해서 쓸 줄 아는 ‘전략가’이기도 한 것\"",
