		"text": "\"지젝이 처음부터 공산주의를 표방한 것은 아니었다. / 이후 지젝은 본격적으로 ‘정통 마르크스-레닌주의’로 전향(혹은 복귀)하는 ‘손쉬운 해결책’을 취한다. 마르크스-레닌을 이야기하면 왠지 진보적이라는 아우라가 생기지 않는가?\"",
