		"id": 786508918881005600,
		"id_str": "786508918881005570",
		"text": "이는 지젝을 주로 인용하는 대부분의 저술들이 영화 평론계에서 나온 이유이기도 하다. 물론 한국의 정신분석학 연구자들 사이에서 라캉 이론이 조금씩 수용되기 시작하면서 지젝도 함께 언급되고 있지만 대개 단편적인 경우가 많다.\"",
