		"id": 786508755546452000,
		"id_str": "786508755546451969",
		"text": "활발해지면서 지젝은 독특하고 탁월한 영화 분석가로서 차츰 알려지기 시작했다. 지젝은 거의 모든 영역에서 논쟁적인 글쓰기를 하고 있고, 특히 정치에 대한 철학적 비판에 집중하고 있지만, 한국에서는 영화 부문을 중심으로 대중문화 비평가로서 수용됐던 셈이다",
