		"text": "\"한국에서 지젝이 처음 소개된 계기는 라클라우의 포스트맑스주의 논쟁 과정에서 그의 짧은 논문이 번역된 것이었다. 그러나 그때는 지젝이 누구인지 분명하지 않았고 곧 잊혀졌다. 그 후 한국 지식사회에서 포스트모더니즘의 부상과 더불어 영화에 대한 관심이",
