		"id": 786327780539588600,
		"id_str": "786327780539588608",
		"text": "가라타니에 쏟아진 비판은 괴델이나 비트겐슈타인을 오독하고 있다는 철학계에 의한 것이었는데, 이들의 비판은 정당하나 90년대 후반 민음사에서 (프랑스철학의 조류와 맞물려) '일본 뉴아카'를 소개하며 가라타니가 수입되었기에 '전기 가라타니'는 간과됐어요.",
