			"text": "그러니까 알탕문화가 그렇듯 남자들간의 유대감을 위해 그 자리에 없는 여자를 씹고 뜯고 맛보고 하는게 아니라. 커뮤니티의 일원인 나와 친해지기 위해 그런 접근을 한다는게 오덕문화의 크리피 포인트임. 우상이 아닌 여성의 존재를 이해 못하는거 같았음.",
