		"text": "이건 비평 언어에 숙달되어도 특정한 이론적(언어적) 기반에 메여있기 마련이기에 마찬가지. 자기 안의 느낌, 감상, 의미의 왜곡은 피할 수 없고 사실 어떤 부분에서는 이걸 왜곡이라 하는 것도 부적합해요. 그렇게 세계가 인식되고 보이는 거니까.",
