		"text": "\"앞서 말했듯이 한국 사회의 구성원들이 ‘국민’이라는 호명을 받아들인 것은 중산층 양성이라는 국가적 목표를 일정 정도 자기 삶의 비전으로 공유했기 때문이다. 그런데 그 목표의 부분적인 실현조차 국가가 보증해줄 수 없는 상황이 되어버린 것이다.\"",
