		"text": "\"식민지 노동력을 자본주의적으로 착취하기 위해서는 자본주의적 노동, 자본주의적 규율, 자본주의적 사고, 자본주의적 생활을 만들어내야 했다는 것이다. 가령 일본 총독부가 학교를 세우고, 애들을 학교 보내라고 종용하고 다닌 것은 바로 그런 이유에서였다.\"",
