		"text": "오타쿠 자신도 시대를 따라서 쉽고 강하게 변용하는데, '요즘 젊은 오타쿠는'하고 분석하는 재미는 있지만, 아즈마가 제기한 세대론 그 자체는 좋은 프레임이 아니라고 생각해요. 문화의 시대상을 구분 짓는 시대론이 더 적확하죠.",
